import React from "react";

const initialState = {
  inbox: [],
};

const reducer = (state, action) => {
  switch (action.type) {
    case "load":
      return {
        ...state,
      };

    default:
      break;
  }
};

const Test = () => {
  const [state, action] = useReducer(reducer, initialState);
  return <div></div>;
};

export default Test;
